import React from 'react';

function About() {
  return (
    <section className="my-5">
      <div className="my-2">
        <div className="profile-img my-5">
        <i className="fas fa-user-circle" style={{ fontSize: "96px" }}></i>
        </div>
        <p>
        Hi, my name is Emerald Green, and I am a full-stack web application developer, currently living in Austin, TX. I have a Bachelor of Arts in Organismal Biology & Ecology and Classics from Colorado College. I committed my post-undergraduate career to advancing equity with mission-based organizations in my community. I served as the Consumer Assistance Program Coordinator for Colorado Consumer Health Initiative and the Program Coordinator for the F2F (family to family) project at Family Voices Colorado. I am excited to apply my skills in problem-solving and project management to web development. 
        </p>
        <p>
        Before taking the University of Denver's full-stack bootcamp, my experience with coding was  using Python during the Tennessee Governor's School for the Sciences and Engineering summer program.
        </p>
      </div>
    </section>
  );
}

export default About;
